import React, { Component } from 'react'
import { TiDelete } from "react-icons/ti";
import { MdOutlineEdit } from "react-icons/md";

interface IVeterinariansInfo {
    handleDeleteVetData: (id: string) => void;
    
    post: {
        id : string;
        name: string;
        dateOfBirth: string;
        phoneNumber: string;
        education: string;
    };
}

interface IVeterinariansInfo {
    handlePutVetData: (id: string) => void;
    
    post: {
        id : string;
        name: string;
        dateOfBirth: string;
        phoneNumber: string;
        education: string;
    };
}

const VeterinariansInfo: React.FC<IVeterinariansInfo> = ({handleDeleteVetData, handlePutVetData , post}) =>  {
        
        return (
            <div>
                <div >
                    {post.name}, {post.dateOfBirth}, {post.phoneNumber}, {post.education}
                    <TiDelete className='styleIcons' onClick={() => {
                        handleDeleteVetData(post.id);
                        }}></TiDelete>
                </div>
                <div>
                    <MdOutlineEdit className='styleIcons' onClick={() => {
                        handlePutVetData(post.name);
                    }}></MdOutlineEdit>
                </div>
            </div>
        );
    
};

export default VeterinariansInfo
